import React from 'react';
import { Carousel } from 'react-bootstrap';

function Slider() {
  return (
    <Carousel>
      {[...Array(5)].map((_, i) => (
        <Carousel.Item key={i}>
          <div className="d-block w-100 bg-secondary text-white text-center" style={{ height: '300px' }}>
            <h3 className="mt-5">Slide {i + 1}</h3>
            <p>This is a placeholder for slide {i + 1}.</p>
          </div>
        </Carousel.Item>
      ))}
    </Carousel>
  );
}

export default Slider;
